import React from 'react'
import Card from 'react-bootstrap/Card';


function Dice({ image, name }) {
  return (
    <Card className='col-sm-3 col-lg-3' id='diceCard'>
    <Card.Img variant="top" src={image} />
    <Card.Body>
      <Card.Title>{name}</Card.Title>
      <Card.Text>
        {name}
      </Card.Text>
    </Card.Body>
  </Card>
  )
}

export default Dice
